import React from "react";

class Section extends React.Component {
    render() {
        return (
            <div className="container mt-4">
                <div className="row justify-content-start">
                    <div className="col-4">
                        <p>
                        Laudantium sapiente beatae consequuntur officia ab, voluptates curae! Litora pellentesque exercitation nisi turpis nihil, maiores rerum, auctor augue fugit modi cubilia exercitation! Architecto a! Officia corrupti. Laboriosam? Delectus? Wisi congue, neque tortor, tempora! Ea quibusdam perspiciatis quod sagittis? Quisquam eligendi? Adipisci alias? Urna proident aliquip! Parturient sapiente fuga, phasellus tempus dapibus numquam montes ipsam! Quae eum, potenti nemo tincidunt provident phasellus alias quam adipisci magna. Proident facilisis molestie praesent lorem, perspiciatis integer laudantium anim, eleifend, magni cupiditate doloremque nisi suscipit elit tortor facilisi a wisi ipsa consectetur? Rerum voluptates, expedita dolorum integer porttitor non vitae! Sollicitudin, fugit quod, quidem posuere.

                        </p>
                    </div>
                    <div className="col-4">
                        One of two columns
                    </div>
                </div>
            </div>
        );
    }
}

export default Section;
